import { types } from "@babel/core";

var initialState = [
    {
        id : 1,
        name : 'abc' ,
        status: true,
    }
];

var myReducer = (state = initialState , action) => {
    switch (action.type) {
        case types.LIST_ALL:
            return state;
        default: return state
    }

}

export default myReducer;
